import React, {useState} from 'react'
import '../style/NavBar.css'

const NavBar = () => {
    const [activeLink, setActiveLink] = useState("/ChampionsLeague");

    const handleClick = (href) => {
        setActiveLink(href);
    };

    return (
        <nav className='navbar'>
            <ul>
                <li><a className={activeLink === "/ChampionsLeague" ? 'active' : ''} onClick={() => handleClick("/ChampionsLeague")} href="/ChampionsLeague">UCL</a></li>
                <li><a className={activeLink === "/PremierLeague" ? 'active' : ''} onClick={() => handleClick("/PremierLeague")} data-test="premier-league-link" href="/PremierLeague">PREMIER LEAGUE</a></li>
                <li><a className={activeLink === "/League1" ? 'active' : ''} onClick={() => handleClick("/League1")} href="/League1">LEAGUE 1</a></li>
                <li><a className={activeLink === "/Bundesliga" ? 'active' : ''} onClick={() => handleClick("/Bundesliga")} href="/Bundesliga">BUNDESLIGA</a></li>
                <li><a className={activeLink === "/SerieA" ? 'active' : ''} onClick={() => handleClick("/SerieA")} href="/SerieA">SERIE A</a></li>
                <li><a className={activeLink === "/LaLiga" ? 'active' : ''} onClick={() => handleClick("/LaLiga")} href="/LaLiga">LA LIGA</a></li>
            </ul>
        </nav>
    )
}

export default NavBar;
